private void addQNameXMLEvent(QName qName, XMLEvent event) {
  List<XMLEvent> events = qNameXMLEventsMap.get(qName);
  if (events == null) {
    events = new ArrayList<XMLEvent>();
    qNameXMLEventsMap.put(qName, events);
  }
  events.add(event);
}
